import React from 'react';
import { Card, CardContent, Typography, Avatar, Box } from '@mui/material';
import { Favorite, ChatBubbleOutline, Share } from '@mui/icons-material';

const Post = ({ post }) => {
  return (
    <Card sx={{ marginBottom: '15px', borderRadius: '15px', padding: '10px', boxShadow: 2 }}>
      <Box sx={{ display: 'flex', alignItems: 'center', marginBottom: '10px' }}>
        <Avatar src={post.profilePicture} alt={post.username} sx={{ marginRight: '10px' }} />
        <Typography variant="h6">{post.username}</Typography>
      </Box>
      <CardContent>
        <Typography variant="body1" sx={{ marginBottom: '10px' }}>
          {post.content}
        </Typography>
        <Box sx={{ display: 'flex', justifyContent: 'space-between' }}>
          <Box sx={{ display: 'flex', alignItems: 'center', cursor: 'pointer' }}>
            <Favorite sx={{ marginRight: '5px' }} />
            <Typography variant="body2">Like</Typography>
          </Box>
          <Box sx={{ display: 'flex', alignItems: 'center', cursor: 'pointer' }}>
            <ChatBubbleOutline sx={{ marginRight: '5px' }} />
            <Typography variant="body2">Comment</Typography>
          </Box>
          <Box sx={{ display: 'flex', alignItems: 'center', cursor: 'pointer' }}>
            <Share sx={{ marginRight: '5px' }} />
            <Typography variant="body2">Share</Typography>
          </Box>
        </Box>
      </CardContent>
    </Card>
  );
};

export default Post;
